				<div class="et_pb_text_inner"><h3>We are <?=app_name; ?></h3>
<p><?=app_name; ?> relieves the strain of HR and Payroll administration, freeing up your company resources to grow your business.</p>
<h3>Our Mission</h3>
<p>To empower companies to focus on success.</p>
<h3>We Are Defined By Our Values:</h3>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">FRESH THINKING</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We lead market trends, we don’t follow them – customers can count on us to look around the corner on their behalf.</span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">RELENTLESS</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We’ve got our customers’ backs when they need us most, and we won’t stop working until we have a solution that works for them.</span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">INVESTED</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We own our customers’ business results like they’re our own, and stand by their side to deliver results.</span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">RESPONSIVE</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We put the needs of our customers and their people first. When our customers need us, we are there every time.</span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">STRATEGIC</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We are purposeful in building holistic and integrated strategies that unleash business growth and empower people potential.</span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">PERSONAL</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We know what’s important to our customers and their people, their biggest challenges and what success looks like for them.<b> </b></span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">TRUSTWORTHY</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">We give our customers the straight talk necessary to make complex decisions, even in the most challenging times.</span></p>
<p><b><span style="font-family: 'Arial',sans-serif; color: #00b050;">OPTIMISTIC</span></b><b><span style="font-family: 'Arial',sans-serif;"><br /></span></b><span style="font-family: 'Arial',sans-serif;">Where others see challenges too difficult to own, we see opportunities to capture and lead the market.</span></p>
<h3>Our Story</h3>
<p>Since 2003, we have been providing long-term strategies to help our clients control costs by reducing risks and managing payroll, human resources and employee benefits. No two companies are alike. That’s why we take the time to work closely with companies to design a package of services to fit their needs.</p>
<h3>What makes us unique:</h3>
<ul>
<li><strong>Customized Solutions</strong> – Solutions customized to the unique needs of your company.</li>
<li><strong>Advanced Technology</strong> – Cutting-edge tools to enhance your capabilities and improve efficiency.</li>
<li><strong>Specialists in Every Department</strong> – To provide valuable information and guidance.</li>
<li><strong>Effective Implementation</strong> – To fully understand the needs and objectives of your company and ensure a smooth and timely transition.</li>
<li><strong>Single Point of Contact</strong> – Your Personal Account Manager becomes your single point of contact offering you exceptional support and quick responses.</li>
</ul></div>
